import React from "react";

function ImageList(props) {
  return (
    <div>
      <div>
        {props.images.length > 0 &&
          props.images.map((id, largeImageURL, tags) => {
            return (
              <div>
                <img src={largeImageURL} alt={tags} />
              </div>
            );
          })}
      </div>
    </div>
  );
}

export default ImageList;
